// Hole das Scoring aus den Webhook-Daten
const scoring = parseFloat($node["Heyflow"].json.body.fields.scoring)

let scoringResult = "";

// Logik zur Zuordnung des scoringResult
if (scoring >= 211 && scoring <= 280) {
    scoringResult = "Aphrodite";
} else if (scoring >= 141 && scoring <= 210) {
    scoringResult = "Hera";
} else if (scoring >= 71 && scoring <= 140) {
    scoringResult = "Athena";
} else if (scoring >= 0 && scoring <= 70) {
    scoringResult = "Artemis";
} else {
    scoringResult = "Ungültiger Scoring-Wert";
}

// Ergebnis zurückgeben
return {
    scoring: scoring,
    scoringResult: scoringResult
};

// Holt die Daten aus dem Heyflow-Node
const fields = $node["Heyflow"].json.body.fields;

// Liste der Felder, die entfernt werden sollen
const excludedFields = [
  "first_name",
  "last_name",
  "email",
  "phone",
  "utm_campaign",
  "utm_content",
  "utm_medium",
  "utm_source",
  "utm_term",
  "placement"
];

// Liste der Felder, bei denen Zahlen nicht entfernt werden sollen
const exceptionFields = ["Dein Alter", "scoring"];

// Initialisiert ein Objekt für die gefilterten Felder
const result = {};

// Überprüft, ob `fields` ein Array oder Objekt ist
if (Array.isArray(fields)) {
  // Falls es ein Array ist, iterieren wir mit forEach
  fields.forEach(field => {
    if (!excludedFields.includes(field.name)) {
      // Wenn das Feld in der Ausnahmeliste ist, behalten wir die Zahlen
      if (exceptionFields.includes(field.name)) {
        result[field.name] = field.value || '';
      } else {
        // Entfernt Zahlen aus dem Wert
        result[field.name] = (field.value || '').replace(/[0-9]/g, '').trim();
      }
    }
  });
} else if (typeof fields === 'object' && fields !== null) {
  // Falls es ein Objekt ist, iterieren wir über dessen Schlüssel
  Object.entries(fields).forEach(([key, value]) => {
    if (!excludedFields.includes(key)) {
      // Wenn das Feld in der Ausnahmeliste ist, behalten wir die Zahlen
      if (exceptionFields.includes(key)) {
        result[key] = value || '';
      } else {
        // Entfernt Zahlen aus dem Wert
        result[key] = (value || '').replace(/[0-9]/g, '').trim();
      }
    }
  });
} else {
  // Falls die Struktur unerwartet ist, gibt einen Fehler aus
  return { error: "Unexpected fields structure", fields };
}

// Gibt die bereinigten Felder zurück
return { filteredFields: result };
